import { useEffect, useState } from "react";

export default function Manage_Students() {
  const [students, setStudents] = useState([])


  const fetchStudents = async () => {
    const res = await fetch(`/all_books`);
    const data = await res.json();
    setStudents(data);
  };

  useEffect(() => {
    fetchStudents();
  }, [])


  return (
    <div>
      <h2> Students </h2>
    </div>
  );

}
